import React from 'react';
import './trip.css';
import Card from './Card';

const tripsData = [
  {
    id: 1,
    title: 'Domestic Destinations',
    description: ['Goa','Kerala','Spiti','Rishikesh','Kashmir'],
    imageUrl: 'images1.jpg'
  },
  {
    id: 2,
    title: 'International Destinations',
    description: ['Azerbaijan','Dubai','Thailand','Muscat','Europe'],
    imageUrl: 'ForeverLovedPlaces.jpg'
  }
];

const Trips = () => {
  return (
    <section id="trips" className="trips">
      <h2>Destinations</h2>
      <div className="trips-list">
        {tripsData.map(trip => (
          <div key={trip.id} className="trip-card">
            <Card
              image={`http://localhost:5050/images/${trip.imageUrl}`}
              title={trip.title}
              description={trip.description}
            />
          </div>
        ))}
      </div>
    </section>
  );
};

export default Trips;
